import kosovoImg from "../components/assets/kosovo-flag.png"
import "./Homepage.css"
import {Link} from 'react-router-dom'
import axios from 'axios'

class Homepage extends Component {

    render() {
        return (
            <div>
            <h1>Welcome to Kosova</h1>
            <div>
            <iframe width="260" height="140" src="https://www.youtube.com/embed/4ZEcOzSdZbE?start=1321" frameborder="0" allow="accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>
            </div>
            </div>
        )
    }
}

export default Homepage
